    "A Line segment is a part of a Line bounded by two endpoints. Unlike a Line , a segment has a definite length . The length of segment AB is written as AB (without the bar above).": "Un segmento de línea es una parte de una línea delimitada por dos puntos finales. A diferencia de una línea , un segmento tiene una longitud definida. La longitud del segmento AB se escribe como AB (sin la barra anterior).",
