    "Example: 3, 7, 11, 15, ... has d = 4 and a(n) = 3 + (n−1)(4) = 4n − 1.": "Ejemplo: 3, 7, 11, 15, ... tiene d = 4 y a(n) = 3 + (n−1)(4) = 4n − 1.",
    "Example: 4x + 2 = 2x + 10 → 2x = 8 → x = 4.": "Ejemplo: 4x + 2 = 2x + 10 → 2x = 8 → x = 4.",
    "Example: 5.2 km = 5.2 × 10³ m = 5200 m": "Ejemplo: 5,2 km = 5,2 × 10³ m = 5200 m",
    "Example: 6x² + 9x = 3x(2x + 3). Set each factor equal to 0.": "Ejemplo: 6x² + 9x = 3x(2x + 3). Iguala cada factor a 0.",
    "Example: A blueprint has scale 1 in : 4 ft. A room measures 3.5 in on the blueprint. Actual length = 3.5 × 4 = 14 ft.": "Ejemplo: un plano tiene una escala de 1 pulgada: 4 pies. Una habitación mide 3,5 pulgadas en el plano. Longitud real = 3,5 × 4 = 14 pies.",
    "Example: A person standing 50 m from a building looks up at the top with an Angle of elevation of 60°. Height = 50 × tan 60° = 50√3 ≈ 86.6 m.": "Ejemplo: una persona parada a 50 m de un edificio mira hacia arriba con un ángulo de elevación de 60°. Altura = 50 × tan 60° = 50√3 ≈ 86,6 m.",
    "Example: For x² + 4x + 5 = 0, D = 16 − 20 = −4 < 0 → no real solutions.": "Ejemplo: Para x² + 4x + 5 = 0, D = 16 − 20 = −4 < 0 → no hay soluciones reales.",
    "Example: H₂O": "Ejemplo: H₂O",
    "Example: If C(t) = 50t + 200 represents cost over time, C(3) = 350 means the cost at 3 hours is $350.": "Ejemplo: si C(t) = 50t + 200 representa el costo en el tiempo, C(3) = 350 significa que el costo a las 3 horas es $350.",
    "Example: If a figure is a square, then it is a rectangle. Figure ABCD is a square. Therefore, ABCD is a rectangle.": "Ejemplo: si una figura es un cuadrado, entonces es un rectángulo. La figura ABCD es un cuadrado. Por tanto, ABCD es un rectángulo.",
    "Example: If f(x) = 2x + 1, then f(4) = 2(4) + 1 = 9.": "Ejemplo: si f(x) = 2x + 1, entonces f(4) = 2(4) + 1 = 9.",
    "Example: If it rains, the ground gets wet. If the ground gets wet, the flowers grow. Therefore, if it rains, the flowers grow.": "Ejemplo: Si llueve, el suelo se moja. Si el suelo se moja, las flores crecen. Por tanto, si llueve, las flores crecen.",
    "Example: If two sides are 5 and 11, then the third side must be between 11 − 5 = 6 and 5 + 11 = 16: 6 < c < 16.": "Ejemplo: si dos lados son 5 y 11, entonces el tercer lado debe estar entre 11 − 5 = 6 y 5 + 11 = 16: 6 < c < 16.",
    "Example: If two similar rectangles have a scale factor of 3:5, and the smaller has perimeter 24, the larger has perimeter 24 × (5/3) = 40.": "Ejemplo: si dos rectángulos similares tienen un factor de escala de 3:5 y el más pequeño tiene un perímetro de 24, el más grande tiene un perímetro de 24 × (5/3) = 40.",
    "Example: In a right Triangle with Angle 35° and hypotenuse 10:": "Ejemplo: en un triángulo rectángulo con ángulo de 35° e hipotenusa 10:",
    "Example: In △ABC with AB = 5, BC = 8, AC = 6, the angles from smallest to largest are: ∠C < ∠B < ∠A (Angle opposite the shortest side is smallest).": "Ejemplo: En △ABC con AB = 5, BC = 8, AC = 6, los ángulos de menor a mayor son: ∠C < ∠B < ∠A (El ángulo opuesto al lado más corto es el más pequeño).",
    "Example: Prove a triangle can\\'t have 2 obtuse angles": "Ejemplo: demostrar que un triángulo no puede tener 2 ángulos obtusos",
