    "Example: x² + 5x + 6 = (x + 2)(x + 3) because 2 × 3 = 6 and 2 + 3 = 5.": "Ejemplo: x² + 5x + 6 = (x + 2)(x + 3) porque 2 × 3 = 6 y 2 + 3 = 5.",
    "Example: x² + 6x = 7 → x² + 6x + 9 = 16 → (x+3)² = 16 → x + 3 = ±4 → x = 1 or x = −7.": "Ejemplo: x² + 6x = 7 → x² + 6x + 9 = 16 → (x+3)² = 16 → x + 3 = ±4 → x = 1 o x = −7.",
    "Example: −2x > 6 → x < −3 (flip the sign because you divided by −2).": "Ejemplo: −2x > 6 → x < −3 (cambia el signo porque dividiste por −2).",
    "Example: √(x + 3) = 5 → x + 3 = 25 → x = 22. Check: √25 = 5 ✓": "Ejemplo: √(x + 3) = 5 → x + 3 = 25 → x = 22. Comprueba: √25 = 5 ✓",
